-- Import data from Supabase to MySQL
-- Run with: sudo mariadb -u root survey_profiling < import_from_supabase.sql

SET FOREIGN_KEY_CHECKS=0;

-- Import households
ON DUPLICATE KEY UPDATE purok_gimong=VALUES(purok_gimong);

-- Import family_members
ON DUPLICATE KEY UPDATE full_name=VALUES(full_name);

-- Import health_conditions
ON DUPLICATE KEY UPDATE common_illness_codes=VALUES(common_illness_codes);

-- Import socio_economic
ON DUPLICATE KEY UPDATE income_monthly_code=VALUES(income_monthly_code);

-- Import users
ON DUPLICATE KEY UPDATE username=VALUES(username);

SET FOREIGN_KEY_CHECKS=1;
